ontent -->\n</div>\n\n<!-- Image of location/map -->\n<img src=\"/w3images/map.jpg\" class=\"w3-image w3-greyscale-min\" style=\"width:100%\">\n\n<!-- Footer -->\n<footer class=\"w3-container w3-padding-64 w3-center w3-opacity w3-light-grey w3-xlarge\">\n  <i class=\"fa fa-facebook-official w3-hover-opacity\"></i>\n  <i class=\"fa fa-instagram w3-hover-opacity\"></i>\n  <i class=\"fa fa-snapchat w3-hover-opacity\"></i>\n  <i class=\"fa fa-pinterest-p w3-hover-opacity\"></i>\n  <i class=\"fa fa-twitter w3-hover-opacity\"></i>\n  <i class=\"fa fa-linkedin w3-hover-opacity\"></i>\n  <p class=\"w3-medium\">Powered by <a href=\"https://www.w3schools.com/w3css/default.asp\" target=\"_blank\">w3.css</a></p>\n</footer>\n\n<script>\n// Automatic Slideshow - change image every 4 seconds\nvar myIndex = 0;\ncarousel();\n\nfunction carousel() {\n  var i;\n  var x = document.getElementsByClassName(\"mySlides\");\n  for (i = 0; i < x.length; i++) {\n    x[i].style.display = \"none\";  \n  }\n  myIndex++;\n  if (myIndex > x.length) {myIndex = 1}    \n  x[myIndex-1].style.display = \"block\";  \n  setTimeout(carousel, 4000);    \n}\n\n// Used to toggle the menu on small screens when clicking on the menu button\nfunction myFunction() {\n  var x = document.getElementById(\"navDemo\");\n  if (x.className.indexOf(\"w3-show\") == -1) {\n    x.className += \" w3-show\";\n  } else { \n    x.className = x.className.replace(\" w3-show\", \"\");\n  }\n}\n\n// When the user clicks anywhere outside of the modal, close it\nvar modal = document.getElementById(\'ticketModal\');\nwindow.onclick = function(event) {\n  if (event.target == modal) {\n    modal.style.display = \"none\";\n  }\n}\n</script>\n\n</body>\n</html>\n','ht 11'),(23,470,1,'2024-06-19 02:22:59','Untitled Subject','hi..\n\n [Average Monthly Gross Income]','test 11'),(24,471,1,'2024-06-19 02:24:56','Untitled Subject','ijuhol','u8o'),(25,471,2,'2024-06-19 02:25:01','Untitled Subject','ijuhol','u8o'),(26,472,1,'2024-06-19 03:25:31','